      <div className="App-wrapper">
        <header className="App-header">
          <h1>Bookings</h1>
          <CreateBooking />
        </header>
        <div className="App-main">
          <Bookings bookings={data}/>
        </div>
      </div>
    </div>
  );
}

export default App;
